import React, { useEffect, useState } from 'react';
import Cookies from 'js-cookie';
import { useNavigate } from 'react-router-dom';

const Logout = ({ socket }) => {
    useEffect(() => {
        Cookies.set('8bb052b406ffac0b420918a77c905b0c_user', null, { expires: null });
        navigate('/');
    });
};
  
export default Logout;
